import { Component, Input, OnInit } from '@angular/core';

import { CardService } from './service/card.service';
import { Ideck } from 'src/app/interfaces/Ideck';
import { MatDialog } from '@angular/material/dialog';
import { DeckDetailsComponent } from '../deckdetails/deckdetails.component';
import { EditDeckFormComponent } from '../edit-deck-form/edit-deck-form.component';
import { Data, ICard } from 'src/app/interfaces/Icard';

@Component({
  selector: 'app-cards',
  templateUrl: './cards.component.html',
  styleUrls: ['./cards.component.scss']
})
export class CardComponent implements OnInit {

  @Input() userEmail: string = "";

  public cards: Array<Ideck> = [];

  public numberOfSuperTypes: number = 0;
  public numberOfColors: number = 0;

  constructor(
    private $cardsService: CardService,
    public dialog: MatDialog
  ) {}

  ngOnInit(): void {
    this.getCards();
  }

  getCards() {
    if(this.userEmail) {
      this.$cardsService.getCardsByUser(this.userEmail).subscribe((response: Array<Ideck>) => {
        this.cards = response;
        this.numberOfSuperTypes = this.countNumberOfSuperTypes(this.cards);
        this.numberOfColors = this.countNumberOfColors(this.cards);
      });
    }
  }

  countNumberOfSuperTypes(decks: Array<Ideck>): number {
    let count = new Set();

    decks.forEach(deck => {
      deck.cards.forEach(card => {
        count.add(card['supertype']);
      });
    });
    return count.size;
  }

  countNumberOfColors(decks: Array<Ideck>): number {
    let count = new Set();

    decks.forEach(deck => {
        deck.cards.forEach(card => {
            card['types'].forEach(type => {
                count.add(type);
            });
        });
    });

    return count.size;
  }

  viewDetails(card: Ideck) {
    const dialogRef = this.dialog.open(DeckDetailsComponent, {
      width: '100%',
      height: '100%'
    });

    dialogRef.componentInstance.deck = card;

    dialogRef.afterClosed().subscribe((result: any) => {
    });
  }

  editCard(card: Ideck) {
    const dialogRef = this.dialog.open(EditDeckFormComponent, {
      width: '100%',
      height: '90%'
    });

    dialogRef.componentInstance.deck = card;

    dialogRef.afterClosed().subscribe((result: any) => {
    });
  }

  deleteCard(id: number) {
    this.$cardsService.deleteCardById(id).subscribe((response: any) => {
      this.cards = response;
    });
    this.getCards();
  }
}
<div class="grid space-x-1 lg:grid-cols-6 p-4 gap-2">
  <div *ngFor="let card of cards" class="bg-white border-2 border-gray-400 rounded">
    <div class="bg-white">
      <img class="w-full" src="https://cdn.vox-cdn.com/thumbor/PqAwdNpc7p-5GUCSMxQPehSU-ck=/0x0:1920x1200/1200x800/filters:focal(810x375:1116x681)/cdn.vox-cdn.com/uploads/chorus_image/image/72524797/pikachu_artwork.0.jpg" alt="{{card.name}}">
      <div class="px-6 py-4">
        <div class="font-bold text-xl mb-2">{{card.name}}</div>
        <p class="text-gray-700 text-sm">
          Number of cards:
          <span class="font-bold">
            {{card.cards.length}}
          </span>
        </p>
        <p class="text-gray-700 text-sm">
          Number of Super Types:
          <span class="font-bold">
            {{numberOfSuperTypes}}
          </span>
        </p>
        <p class="text-gray-700 text-sm">
          Number of Colors:
          <span class="font-bold">
            {{numberOfColors}}
          </span>
        </p>
        <p>
          <button mat-mini-fab color="primary" (click)="viewDetails(card)" class="mr-2">
            <mat-icon>search</mat-icon>
          </button>
          <button mat-mini-fab color="primary" (click)="editCard(card)" class="mr-2">
            <mat-icon>create</mat-icon>
          </button>
          <button mat-mini-fab color="warn" (click)="deleteCard(card.id!)">
            <mat-icon>cancel</mat-icon>
          </button>
        </p>
      </div>
    </div>
  </div>
</div>
